// A simple navigation function
function navigate(route) {
  history.pushState(null, '', route);
  render();
}

function loadComponent(path, container) {
  fetch(path)
    .then((response) => response.text())
    .then((data) => (container.innerHTML = data))
    .catch(() => (container.innerHTML = `<h1>404 - Not Found</h1>`));
}

const route =(event)=>{
  event=event||window.event;
  event.preventDefault();
  window.history.pushState({}, '', event.target.href);
  handleLocation();


};
const routes ={
  "/" :"./pages/home/home.js",
  "/about" :"./components/about/about.html",
  "/contact" :"./pages/contact/contact.html",
}

const handleLocation=async()=>{
  const path =window.location.pathname;
  const route =routes[path] || null;
  if (!route) {
    document.getElementById('app').innerHTML = `<h1>404 - Page Not Found</h1>`;
    return;
  }
try {
    const html = await fetch(route).then((data) => data.text());
    document.getElementById('app').innerHTML = html;
  } catch (error) {
    document.getElementById('app').innerHTML = `<h1>Error Loading Page</h1>`;
  }

};


window.route=route;

